import { styled } from "styled-components";


const Wrapper = styled.section`

.inner{
    width:50%;
    margin:auto;
}
.year{
    width:100%;
    margin:auto;
}
.year input{
    width:40px;
    margin:auto;
}
.

`

export default Wrapper;
